/* APIs */
import Link from 'next/link';

/* Styles */
import '../styles/scss/styles.scss';

const Index = () => (
    <div>
        <Link href="/portfolio">
            <a title="Portfolio">Portfolio</a>
        </Link>
        <Link href="/photos">
            <a title="Photos">Photos</a>
        </Link>
    </div>
);

export default Index;
